import React from 'react'

function ToggleArrow({isOpen}) {
  return (<div style={{display: "inline-block", color: "gray", fontSize: "0.8rem", verticalAlign: "middle", paddingLeft: "10px 10px", transform: "rotate(20deg)"}}><span>{isOpen ? "<": ">"}</span></div>
  )
}

export default ToggleArrow
